webpackJsonp([0x61cf31dd3b90],{344:function(e,o){e.exports={data:{markdownRemark:{id:"/Users/cmarlow/Projects/lo-life/src/pages/rediscover-you.md absPath of file >>> MarkdownRemark",html:"<h2>6 week Intensive</h2>\n<p>Feeling lost or a lack of self fulfillment? With this package we will strengthen your connection with your true self.  Begin to expand and deepen your self awareness and bring purpose back to your life.</p>\n<p>What is included:</p>\n<ul>\n<li>Life assessment call (free assessment - 45min)</li>\n<li>6 weekly meetings via phone, Skype, Zoom etc)</li>\n<li>Unlimited Support via phone, email, text or messenger</li>\n<li>6 week methodology + homework &#x26; follow up</li>\n<li>weekly focus on specific segments of your life to help rediscover you</li>\n<li>Tools to help maintain progress and continue your journey after coaching</li>\n<li>Breathing &#x26; Meditation tools</li>\n</ul>\n<p>By the end of this program you will:</p>\n<ul>\n<li>Become more in tuned with yourself, leading to a more inspired, passionate, &#x26; fulfilled life.</li>\n<li>Create a vision board, build a daily routine that supports the realization of your purpose.</li>\n<li>Allow yourself to open your heart to the universe and what is has to offer, allowing your heart to feel more peace, happiness, inspiration &#x26; desire.</li>\n<li>Connect deeper to your true inner goddess, &#x26; how you can better express your authentic self in your everyday life</li>\n<li>Be in love with your most authentic self</li>\n<li>Be on your way to building an unshakeable confidence</li>\n</ul>",frontmatter:{date:"May 21, 2018",path:"/rediscover-you",title:"Rediscover You"}}},pathContext:{}}}});
